            this.setState(res.data);
        })

    }
    render(){
        return (<div>
            <h2>Patient Details:</h2>
            First Name: {this.state.firstName}
            Last Name: {this.state.lastName}
            Age: {this.state.age}
            <h2>Clinical Report:</h2>
            {this.state.clinicalData.map(each)}

        </div>)
    }
}

